    true,nt"url": null,nt"notes": "The dataset includes a list of SFEC 1.126
    Notification of Contract Approval Filings filed with the San Francisco Ethics Commission.Each
    City elective officer who approves a contract that has a value of $50,000 or more
    in a fiscal year must file form SFEC-126 with the Ethics Commission within five
    business days of approval. This filing requirement applies if the contract is approved
    by:(1)the City elective officer, (2) any board on which the City elective officer
    serves, or (3) the board of any state agency on which an appointee of the City elective
    officer serves.To view the filings, proceed to:  http://www.sfethics.org/ethics/contracts/",nt"license_title":
